void calcTotals()
{
    CustomJournalTotalAmounts_RU     totalAmounts;
    TmpCustomJournalTotalsFilters_RU totalsFilters;
    QueryBuildDataSource             qbds = sysQueryRun.query().dataSourceNo(1);

    CustomTotalFilterType_RU filterType(fieldId _fieldId)
    {
        CustomTotalFilterType_RU ret;

        switch (_fieldId)
        {
            case fieldnum(CustomJournalTrans_RU, ItemId)  :
                ret = CustomTotalFilterType_RU::Item;
                break;
            case fieldnum(CustomJournalTrans_RU, feaccId) :
                ret = CustomTotalFilterType_RU::FEACC;
                break;
            case fieldnum(CustomJournalTrans_RU, CustomPartition) :
                ret = CustomTotalFilterType_RU::CustomPartition;
                break;
            case fieldnum(CustomJournalTrans_RU, CountryRegionId) :
                ret = CustomTotalFilterType_RU::CountryRegionId;
        }

        return ret;
    }

    void setFilter(fieldId _fieldId)
    {
        QueryBuildRange qbr = qbds.findRange(_fieldId);

        if (qbr)
        {
            totalsFilters.initRange(customJournalTable.CustomJournalId, filterType(_fieldId), qbr.value());
        }
    }

    setFilter(fieldnum(CustomJournalTrans_RU, ItemId));
    setFilter(fieldnum(CustomJournalTrans_RU, feaccId));
    setFilter(fieldnum(CustomJournalTrans_RU, CustomPartition));
    setFilter(fieldnum(CustomJournalTrans_RU, CountryRegionId));

    totalAmounts = CustomJournalTotalAmounts_RU::createFromJournal(customJournalTable, totalsFilters);
    tmpCustomJournalTotals.initFromCustomJournalTable(customJournalTable, totalAmounts, !totalAmounts.useFilter());
}

void enableControls(boolean _updateButtons = false)
{
    boolean enabled, posted;
    boolean allowEdit = true, allowCreate = true, allowDelete = true;
    boolean factured;
    boolean existLine = (CustomJournalTrans_RU::maxLineNum(customJournalTable.CustomJournalId) != 0);
    boolean inventProfileAllow;

    enabled = (customJournalTable.CustomJournalType == CustomJournalType_RU::Export) ? false : true;
    customJournalTable_ds.object(fieldnum(CustomJournalTable_RU, IncludeIntoCostPrice)).enabled(enabled);
    customJournalTable_ds.object(fieldnum(CustomJournalTable_RU, CustomInventTransStatus)).visible(enabled);
    customJournalTable_ds.object(fieldnum(CustomJournalTable_RU, ChargeAllocationBase)).enabled(customJournalTable.IncludeIntoCostPrice);

    customJournalTrans_ds.object(fieldnum(CustomJournalTrans_RU, InvoiceVAT)).allowEdit(enabled);
    customJournalTrans_ds.object(fieldnum(CustomJournalTrans_RU, InvoiceExcise)).allowEdit(enabled);
    customJournalTrans_ds.object(fieldnum(CustomJournalTrans_RU, IndicativeVAT)).allowEdit(enabled);
    customJournalTrans_ds.object(fieldnum(CustomJournalTrans_RU, IndicativeExcise)).allowEdit(enabled);

    customJournalTrans_ds.object(fieldNum(CustomJournalTrans_RU, ItemNetWeight)).allowEdit(CustomJournalTable.CustomJournalStatus == CustomJournalStatus_RU::Open && !CustomJournalTrans.CustomAmountStorage);
    customJournalTrans_ds.object(fieldNum(CustomJournalTrans_RU, ItemGrossWeight)).allowEdit(CustomJournalTable.CustomJournalStatus == CustomJournalStatus_RU::Open && !CustomJournalTrans.CustomAmountStorage);
    customJournalTrans_ds.object(fieldNum(CustomJournalTrans_RU, Volume)).allowEdit(CustomJournalTable.CustomJournalStatus == CustomJournalStatus_RU::Open);

    customJournalLine.enabled(customJournalTrans.RecId != 0);
    if (customJournalTrans)
    {
        salesPurchTable.enabled(customJournalTrans.SalesPurchId != '');
        salesPurchInvoice.enabled(customJournalTrans.InvoiceId != '');
        custPackingSlipJour.enabled(customJournalTrans.PackingSlipId != '');
    }

    switch (customJournalTable.CustomJournalStatus)
    {
        case CustomJournalStatus_RU::Open:
            break;

        case CustomJournalStatus_RU::Released:
            allowDelete = false;
            allowCreate = false;
            break;

        case CustomJournalStatus_RU::Posted:
            allowDelete = false;
            allowEdit   = false;
            allowCreate = false;
            posted      = true;
            break;
    }

    if (_updateButtons)
    {
        factured = (FactureJour_RU::find(customJournalTable.FactureId, FactureModule_RU::Vend).RecId != 0);
        customJournalGTDFactureCreate.enabled(posted && ! factured);
        customCorrectionCreate.enabled(posted);
        customJournalGTDPost.enabled(customJournalTable.CustomJournalStatus == CustomJournalStatus_RU::Released);
        factureJournalVend.enabled(posted && factured && enabled);
        ledgerTransVoucher.enabled(posted);
        customCorrectionTable.enabled(customJournalTable.existCorrection());
        customJournalChargeCalc.enabled(customJournalTable.CustomJournalStatus == CustomJournalStatus_RU::Open && allowEdit && existLine);
        customJournalCalc.enabled(customJournalTable.CustomJournalStatus == CustomJournalStatus_RU::Open && allowEdit && existLine);
        customJournalCalcDutyPartition.enabled(CustomJournalTable.CustomJournalStatus == CustomJournalStatus_RU::Open && allowEdit && customJournalTrans.CustomPartition);
        newLine.enabled(allowCreate);
        customJournalGTDCreateBase.enabled(allowCreate && existLine);
        customJournalGTDCreate.enabled(customJournalTable.CustomJournalStatus == CustomJournalStatus_RU::Open && allowCreate && existLine);
        customJournalGTDCancel.enabled(customJournalTable.CustomJournalStatus == CustomJournalStatus_RU::Released);
        inventJournalTableTransfer.enabled(customJournalTable.TransferInventJournalId ? true : false);
    }

    customJournalTable_ds.object(fieldnum(CustomJournalTable_RU, TransferInventJournalId)).allowEdit(customJournalTable.CustomJournalStatus == CustomJournalStatus_RU::Open);

    customJournalTable_ds.object(fieldnum(CustomJournalTable_RU, PlanArrivalDate)).allowEdit(allowCreate);
    customJournalTable_ds.object(fieldnum(CustomJournalTable_RU, VendAccountCustom)).allowEdit(allowCreate);
    customJournalTable_ds.object(fieldnum(CustomJournalTable_RU, ChargeAllocationBase)).allowEdit(allowEdit);

    customJournalTable_ds.object(fieldnum(CustomJournalTable_RU, PartnerCode)).allowEdit(! existLine);
    customJournalTable_ds.object(fieldnum(CustomJournalTable_RU, AgreementHeaderExt)).allowEdit(! existLine);

    customJournalTable_ds.object(fieldnum(CustomJournalTable_RU, CustomLocationId)).allowEdit(allowCreate);
    customJournalTable_ds.object(fieldnum(CustomJournalTable_RU, InventProfileId)).allowEdit(allowCreate);
    customJournalTable_ds.object(fieldnum(CustomJournalTable_RU, CountryRegionId)).allowEdit(allowCreate);
    customJournalTrans_ds.object(fieldnum(CustomJournalTrans_RU, CountryRegionId)).allowEdit(allowCreate);

    if (customJournalTable.CustomJournalType        == CustomJournalType_RU::Import &&
        customJournalTable.CustomInventTransStatus  == CustomInventTransStatus_RU::Purchased)
    {
        inventProfileAllow = true;
    }
    else
    {
        inventProfileAllow = false;
    }
    customJournalTable_ds.object(fieldnum(CustomJournalTable_RU, InventProfileId)).allowEdit(inventProfileAllow);
    customJournalTable_ds.object(fieldnum(CustomJournalTable_RU, InventProfileId)).mandatory(false);

    customJournalTable_ds.object(fieldnum(CustomJournalTable_RU, DlvTermId)).mandatory(enabled);
    customJournalTable_ds.object(fieldnum(CustomJournalTable_RU, DlvTermId)).allowEdit(enabled);

    custom.enabled(allowCreate);

    customJournalTable_ds.allowEdit(allowEdit);
    customJournalTable_ds.allowDelete(allowDelete && (customJournalTrans.CustomAmountStorage ? false : true));

    customJournalTrans_ds.allowEdit(allowEdit);
    customJournalTrans_ds.allowDelete(allowDelete);
}

