void jumpRefFromArgs()
{
    InventTrans             inventTrans;
    InventTransOrigin       inventTransOrigin;
    CustomJournalTable_RU   journalTable;
    CustomJournalTrans_RU   journalTrans;

    if (element.args().dataset() == tablenum(InventTrans))
    {
        inventTrans = element.args().record();

        switch (inventTrans.GroupRefType_RU)
        {
            case InventTransGroupRefType_RU::CustomJournalGIT :
                inventTransOrigin = InventTransOrigin::find(inventTrans.InventTransOriginSales_RU);
                select firstonly journalTrans
                    where journalTrans.CustomJournalId          == inventTrans.GroupRefId_RU &&
                          journalTrans.StatusIssue              == inventTrans.StatusIssue   &&
                          journalTrans.StatusReceipt            == inventTrans.StatusReceipt &&
                          journalTrans.SalesPurchInventTransId  == inventTransOrigin.InventTransId;
                break;
            case InventTransGroupRefType_RU::CustomJournalStd :
                inventTransOrigin = InventTransOrigin::find(inventTrans.InventTransOrigin);
                select firstonly journalTrans
                    where journalTrans.CustomJournalId          == inventTrans.GroupRefId_RU &&
                          journalTrans.StatusIssue              == inventTrans.StatusIssue   &&
                          journalTrans.StatusReceipt            == inventTrans.StatusReceipt &&
                          journalTrans.SalesPurchInventTransId  == inventTransOrigin.InventTransId;
                break;
        }

        if (journalTrans)
        {
            journalTable = CustomJournalTable_RU::find(journalTrans.CustomJournalId);
            customJournalTable_ds.positionToRecord(journalTable);
            customJournalTrans_ds.positionToRecord(journalTrans);
        }
    }
}

    public void jumpRefSalesPurchInvoice()
    {
        Args                args = new Args();
        CustInvoiceJour     custInvoiceJour;
        CustInvoiceTrans    custInvoiceTrans;
        VendInvoiceJour     vendInvoiceJour;
        VendInvoiceTrans    vendInvoiceTrans;
		MenuFunction 		menuFunction;

        if (customJournalTrans.customJournalTable().CustomJournalType == CustomJournalType_RU::Export)
        {
			menuFunction = new MenuFunction(menuItemDisplayStr(CustInvoiceJournal), MenuItemType::Display);			

            select firstonly custInvoiceJour
                where custInvoiceJour.InvoiceId         == customJournalTrans.InvoiceId &&
                      custInvoiceJour.SalesId           == customJournalTrans.SalesPurchId
            exists join custInvoiceTrans
                where custInvoiceTrans.InvoiceId        == custInvoiceJour.InvoiceId    &&
                      custInvoiceTrans.InvoiceDate      == custInvoiceJour.InvoiceDate  &&
                      custInvoiceTrans.InventTransId    == customJournalTrans.SalesPurchInventTransId;

            args.record(custInvoiceJour);
        }
        else
        {
			menuFunction = new MenuFunction(menuItemDisplayStr(VendInvoiceJournal), MenuItemType::Display);

            select firstonly vendInvoiceJour
                where vendInvoiceJour.InvoiceId         == customJournalTrans.InvoiceId &&
                      vendInvoiceJour.PurchId           == customJournalTrans.SalesPurchId
            exists join vendInvoiceTrans
                where vendInvoiceTrans.InvoiceId        == vendInvoiceJour.InvoiceId    &&
                      vendInvoiceTrans.InvoiceDate      == vendInvoiceJour.InvoiceDate  &&
                      vendInvoiceTrans.InventTransId    == customJournalTrans.SalesPurchInventTransId;

            args.record(vendInvoiceJour);
        }

        menuFunction.run(args);
    }

