    }

public void setTitleText()
{
    if (customJournalTable.CustomJournalId)
    {
        headerTitle.text(strFmt('%1 : %2 - %3', customJournalTable.CustomJournalId,
                                                customJournalTable.PartnerCode,
                                                customJournalTable.partnerName()));
    }
    else
    {
        headerTitle.text("@GLS115008");
    }
}

public boolean unpack(container packedClass)
{
    Version     version = RunBase::getVersion(packedClass);
    container   queryCon;

    switch (version)
    {
        case currentVersion:
            [version, queryCon] = packedClass;
            if (SysQuery::isPackedOk(queryCon))
                sysQueryRun = new SysQueryRun(queryCon);
            else
                this.initQuery();
            break;
        default:
            return false;
    }

    return true;
}

void updateChangeInLines()
{
    customJournalTrans.updateChangeInLines();

    if (customJournalTrans_DS.validateWrite())
    {
        customJournalTrans_DS.write();
    }

    customJournalTable.reread();
    customJournalTable.updateChangeInLines();
    customJournalTable_DS.reread();
    customJournalTable_DS.refresh();
}

