}

public void init()
{
    super();

    if (factureSource)
    {
        this.query().dataSourceTable(tablenum(CustomJournalTable_RU)).addRange(fieldnum(CustomJournalTable_RU, RecId)).value(factureSource.jourRange());
    }

    this.cacheAddMethod(tablemethodstr(CustomJournalTable_RU, agreementDocumentTitle));
}

public void create(boolean _append = false)
{
    CustomJournalTable_RU   newCustomJournalTable;

    if (customJournalTableForm.create())
    {
        newCustomJournalTable = CustomJournalTable_RU::find(customJournalTableForm.newJournalId());

        if (newCustomJournalTable)
        {
            customJournalTable_ds.executeQuery();
            customJournalTable.data(newCustomJournalTable);
            element.enableControls(true);
            customJournalTable_ds.write();
            customJournalTable_ds.rereadReferenceDataSources();
        }
    }
    else
    {
        if (TradeFormHelper::isCalledFromForm(element.args()))
        {
            element.close();
        }
    }
}

public int active()
{
    int ret;

    ret = super();

    element.setTitleText();

    customJournalTrans_ds.executeQuery();
    element.enableControls(true);

    return ret;
}

display NoYes hasCustomCorrectionTable(CustomJournalTable_RU  _customJournalTable)
{
    if ((select customCorrectionTable_RU where customCorrectionTable_RU.JournalId == _customJournalTable.CustomJournalId).RecId)
    {
        return NoYes::Yes;
    }

    return NoYes::No;
}

public void write()
{
    CustomJournalTrans_RU  localCustomJournalTrans;

    if (!DimensionDefaultFacade::areEqual(customJournalTable.DefaultDimension, customJournalTable.orig().DefaultDimension))
    {
        select firstonly localCustomJournalTrans
            where localCustomJournalTrans.CustomJournalId == customJournalTable.CustomJournalId;
        if (localCustomJournalTrans && Box::yesNo("@GLS115394", DialogButton::Yes) == DialogButton::Yes)
        {
            ttsbegin;
            while select forupdate localCustomJournalTrans
                where localCustomJournalTrans.CustomJournalId == customJournalTable.CustomJournalId
            {
                localCustomJournalTrans.DefaultDimension = customJournalTable.DefaultDimension;
                localCustomJournalTrans.doUpdate();
            }
            ttscommit;
        }
    }

    super();
}

