public void lookup(FormControl _formControl, str _filterStr)
{
    void    allLocationsLookup()
    {
        SysTableLookup       sysTableLookup       = SysTableLookup::newParameters(tablenum(InventLocation), _formControl);
        Query                query                = new Query();
        QueryBuildDataSource queryBuildDataSource = query.addDataSource(tablenum(InventLocation));

        sysTableLookup.addLookupfield(fieldnum(InventLocation, InventLocationId));
        sysTableLookup.addLookupfield(fieldnum(InventLocation, Name));
        sysTableLookup.addLookupfield(fieldnum(InventLocation, VendAccountCustom_RU));

        queryBuildDataSource.addRange(fieldnum(InventLocation, VendAccountCustom_RU)).value(SysQuery::valueNotEmptyString());

        sysTableLookup.parmQuery(query);

        sysTableLookup.performFormLookup();
    }

    if (!CustomJournalTable.VendAccountCustom)
    {
        allLocationsLookup();
        return;
    }

    super(_formControl, _filterStr);
}

public void lookup(FormControl _formControl, str _filterStr)
{
    void lookupAllPosts()
    {
        SysTableLookup          sysTableLookup;
        Query                   query;
        QueryBuildDataSource    qbds;
        QueryBuildFieldList     qbfl;

        query = new query();
        qbds = query.addDataSource(tableNum(CustomPosts_RU));
        qbfl = qbds.fields();
        qbfl.clearFieldList();
        qbfl.addField(fieldNum(CustomPosts_RU, PostId));
        qbfl.addField(fieldNum(CustomPosts_RU, PartnerCode));

        sysTableLookup = SysTableLookup::newParameters(tableNum(CustomPosts_RU), _formControl);
        sysTableLookup.addLookupfield(fieldNum(CustomPosts_RU, PostId), true);
        sysTableLookup.addLookupfield(fieldNum(CustomPosts_RU, PartnerCode));
        sysTableLookup.parmQuery(query);
        sysTableLookup.performFormLookup();
    }

    if (!CustomJournalTable.VendAccountCustom)
    {
        lookupAllPosts();
        return;
    }

    super(_formControl, _filterStr);
}

